import React from 'react';
import {Button} from '../../components/Button/Button';
import TextField from '@material-ui/core/TextField'
import './login.css'

const Login = () =>  {
    return (
        <div  className>
            <TextField label='Email cím:'/>
            <TextField label='Jelszó:' />

        <div > 
            <Button label="Bejelentkezés" primary="true" ></Button>
            <Button label="Regisztráció" primary="true"></Button>
        </div>
        </div>
    )
}

export default Login;
